import React from "react";
import Card from './netflixCard/Cards';
// import Add , {Sub , Mul ,Divi} from './simpleCalculator/Calculator';
// import Heading from './miniProject/heading';
// import Heading from './Heading';
// import Para from './Para'; 
// import Orderlist from './Orderlist';


function App(){
  return(
    <>

    <h1>Welcome to Ecommerce Website</h1>
     <Card imgsrc = 'https://picsum.photos/200/300'
      title = ''
      sname = 'Ecommerce Website'
      link = 'https://pilmifresh.com/?gad_source=1&gclid=Cj0KCQiA5fetBhC9ARIsAP1UMgEqKSFybfMUuVjIZy-IdWaZOD_AUPNd_MnWG-rSdT8iMRYqhk4q6-gaAkt7EALw_wcB'
     />
     <Card imgsrc = 'https://picsum.photos/200'
      title = 'Product1'
      sname = 'Ecommerce Website1'
      link = 'https://pilmifresh.com/?gad_source=1&gclid=Cj0KCQiA5fetBhC9ARIsAP1UMgEqKSFybfMUuVjIZy-IdWaZOD_AUPNd_MnWG-rSdT8iMRYqhk4q6-gaAkt7EALw_wcB'
     />
     <Card  imgsrc =  'https://picsum.photos/seed/picsum/200/300'
        title = 'Product2'
        sname = 'Ecommerce Website2'
       link = 'https://pilmifresh.com/?gad_source=1&gclid=Cj0KCQiA5fetBhC9ARIsAP1UMgEqKSFybfMUuVjIZy-IdWaZOD_AUPNd_MnWG-rSdT8iMRYqhk4q6-gaAkt7EALw_wcB'
     />
    </>
  );
}


export default App;






